$(document).ready(function(){$(".editable").editable("calls/putsettings.php",{width:"50px",height:"15px",indicator:"<img src='../../../Assets/images/indicator.gif'>",tooltip:"Click to edit...",submit:"Save"});$("#startcali").click(function(){var h=$.parseJSON($("#caliinfo").text());$.each(h,function(h,c){var i,a,b,d,j,k;i=parseInt(c.test);k=c.tname;a=parseInt(c.mul);b=parseInt(c.rem);d=parseInt(c.offset);b>0&&(a+=1);if(b>0||a>0)for(var f=0;f<a;f++)j=b>0&&f==a-1?b:d,$.ajaxq("cali",{url:"calls/calibrate.php", data:"test="+i+"&total="+a+"&par="+f+"&par_size="+d+"&N_rows="+j,cache:!1,beforeSend:function(){for(var g=this.data.split("&"),a=0;a<g.length;a++){var e=g[a].split("="),c=e[0],e=parseInt(e[1]);switch(c){case "par":var b=e;break;case "par_size":var f=e;break;case "N_rows":var d=e;break;case "total":var h=e}}g=b*f;d=g+d-1;$("#caliresult").empty().addClass("loading").append(k+"("+h+" partitions)<br />processing partition "+b+", row "+g+" ~ "+d)},success:function(a){a!="ok"?$("#caliresult").append(a+ "<br />").removeClass("loading"):$("#caliresult").append("<br />--Done<br />").removeClass("loading")}})})})});